import React from 'react';
import Select from './field/select';

function Question3({data, onChange}) {
  return (
    <div>
      <h1 className="question">Question 3</h1>
      <p>Select your life core values, by order of importance to you. In other words, select what you want to experience in your daily life, making them habits you believe will move you towards your Vision. (Select 5 values).</p>
      <ol>
        <li> 
          <Select 
            id="value1"
            value={data.my_values.value1}
            onChange={onChange}
          /> 
          <br /> 
        </li>
        <li>
          <Select 
            id="value2"
            value={data.my_values.value2}
            onChange={onChange}
          />
          <br /> 
        </li>
        <li>          
          <Select 
            id="value3"
            value={data.my_values.value3}
            onChange={onChange}
          />
          <br />
        </li>
        <li>          
          <Select 
            id="value4"
            value={data.my_values.value4}
            onChange={onChange}
          />
          <br />
        </li>
        <li>          
          <Select 
            id="value5"
            value={data.my_values.value5}
            onChange={onChange}
          />
          <br />
        </li>
      </ol>
    </div>
  );
}

export default Question3;
